import React, { useEffect } from 'react'
import { StyleSheet, Text, View, Image, TextInput, ScrollView, Keyboard, Alert, Button, TouchableOpacity } from 'react-native';
import axios from 'axios'
import AsyncStorage from '@react-native-async-storage/async-storage';
import { Box, Heading, VStack, FormControl, Input, Center, NativeBaseProvider, } from "native-base";
import { Formik, Form, Field } from 'formik';
import * as Yup from 'yup';


export default function Login({ navigation }) {

    const [loading, setLoading] = React.useState(false);
    const [failedLogin, setfailedLogin] = React.useState(false);

    const SignupSchema = Yup.object().shape({
        FirstName: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        LastName: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        Phone: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        Adress: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        password: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        confirmPassword: Yup.string()
            .oneOf([Yup.ref('password'), null], 'Passwords must match')
            .required('Required'),
        email: Yup.string().email('Invalid email').required('Required'),

    });




    /*     // Login user
        const login = async (inputs) => {
            try {
                const response = await axios.post("http://192.168.1.14:5000/users/" + 'login', inputs)
                const jsonValue = JSON.stringify(response.data)
                await AsyncStorage.setItem('user', jsonValue)
                navigation.navigate('AffectedZonesList')
            } catch (e) {
                setfailedLogin(true)
    
                console.log("save to storage failed")
            }
    
        } */

    /*    const getDataFromStorage = async () => {
           try {
               const jsonValue = await AsyncStorage.getItem('user')
               return jsonValue != null ? JSON.parse(jsonValue) : null;
           } catch (e) {
               console.log("error getDataFromStorage")
           }
       }
    */


    useEffect(() => {
        /*   getDataFromStorage().then((val) => {
              if (val) {
                  navigation.navigate('AffectedZonesList')
              }
          }); */
    }, [])



    return (
        <View style={styles.container} >

            <Center w="100%">
                <Box safeArea p="2" w="90%" maxW="290" py="8" h="100%" >

                    <Heading mt="1" color="coolGray.600" _dark={{
                        color: "warmGray.200"
                    }} fontWeight="medium" size="xs">

                        <Image
                            style={styles.tinyLogo}
                            source={{
                                uri: 'https://ey.co.il/wp-content/uploads/2021/11/logo-black.png',
                            }}
                        />
                    </Heading>
                    <Heading mt="1" color="coolGray.600" _dark={{
                        color: "warmGray.200"
                    }} fontWeight="medium" size="xs">
                        Sign up to continue!
                    </Heading>
                    {/*         <VStack space={3} mt="5">
                        <FormControl>
                            <FormControl.Label>FirstName</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>LastName</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>Phone</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>Adress</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>Email</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>Password</FormControl.Label>
                            <Input type="password" />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>Confirm Password</FormControl.Label>
                            <Input type="password" />
                        </FormControl>

                        <TouchableOpacity
                            style={styles.button}
                        >
                            <Text style={styles.textStyle}>REGISTER</Text>
                        </TouchableOpacity>
                    </VStack> */}

