                        initialValues={{ email: '', FirstName: '', LastName: '', Phone: '', Adress: '', password: '', confirmPassword: '' }}
                        validationSchema={SignupSchema}
                        onSubmit={values => {
                            // same shape as initial values
                            console.log(values);
                        }}
                    >
                        {({ handleChange, handleBlur, handleSubmit, values, errors, touched }) => (
                            <View>
                                <FormControl.Label>first Name</FormControl.Label>
                                <Input
                                    onChangeText={handleChange('FirstName')}
                                    onBlur={handleBlur('FirstName')}
                                    value={values.FirstName} />
                                {touched.FirstName && errors.FirstName && <Text>{errors.FirstName}</Text>}

                                <FormControl.Label>Last Name</FormControl.Label>
                                <Input
                                    onChangeText={handleChange('LastName')}
                                    onBlur={handleBlur('LastName')}
                                    value={values.LastName} />
                                {touched.LastName && errors.LastName && <Text>{errors.LastName}</Text>}
                                <FormControl.Label>Phone</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('Phone')}
                                    onBlur={handleBlur('Phone')}
                                    value={values.Phone} />
                                {touched.Phone && errors.Phone && <Text>{errors.Phone}</Text>}
                                <FormControl.Label>Adress</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('Adress')}
                                    onBlur={handleBlur('Adress')}
                                    value={values.Adress} />
                                {touched.Adress && errors.Adress && <Text>{errors.Adress}</Text>}
                                <FormControl.Label>Email</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('email')}
                                    onBlur={handleBlur('email')}
                                    value={values.email} />
                                {touched.email && errors.email && <Text>{errors.email}</Text>}
                                <FormControl.Label>password</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('password')}
                                    onBlur={handleBlur('password')}
                                    value={values.password} secureTextEntry />
                                {touched.password && errors.password && <Text>{errors.password}</Text>}
                                <FormControl.Label>confirm Password</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('confirmPassword')}
                                    onBlur={handleBlur('confirmPassword')}
                                    value={values.confirmPassword}
                                    secureTextEntry
                                />
                                {touched.confirmPassword && errors.confirmPassword && <Text>{errors.confirmPassword}</Text>}


                                <VStack space={3} mt="15" >
                                    <TouchableOpacity style={styles.button}>
                                        <Text style={styles.textStyle}>REGISTER</Text>
                                    </TouchableOpacity>
                                </VStack>

                            </View>

                        )}

                    </Formik>
                </Box>
            </Center>;


        </View>

    )



}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        /*  alignItems: 'center',
         justifyContent: 'center', */
    },
    container2: {

        alignItems: 'center',
        justifyContent: 'center',
    },
    tinyLogo: {
        width: 100,
        height: 100,
    },
    input: {
        height: 40,
        margin: 12,
        // borderWidth: 1,
    },

    button: {
        alignItems: "center",
        backgroundColor: "#2c2c3b",
        padding: 10,

    },
    textStyle: {
        color: "yellow",
        fontWeight: 500
    }
});
